    {nom: "clivia miniata", image_url: "data:image/jpeg;base64,", observation: "Le Clivia miniata, souvent simplement appelé Clivia, est une plante à fleurs attrayante et robuste de la famille des Amaryllidaceae, appréciée pour ses grappes de fleurs éclatantes et son feuillage vert foncé. Originaire d'Afrique du Sud, le Clivia prospère dans des conditions qui imitent son habitat naturel sous les arbres forestiers. Voici des conseils spécifiques pour prendre soin de votre Clivia miniata :\n\n### Lumière\n\n- Le Clivia préfère la lumière vive et indirecte. Évitez l'exposition directe au soleil, qui peut brûler ses feuilles. Un emplacement près d'une fenêtre orientée à l'est ou à l'ouest est idéal.\n\n### Arrosage\n\n- Arrosez modérément durant la saison de croissance (printemps et été), en laissant le terreau sécher légèrement entre les arrosages. Réduisez l'arrosage en automne et en hiver, période de repos pour la plante, en maintenant le terreau juste humide.\n- Évitez que l'eau ne stagne au fond du pot pour prévenir la pourriture des racines.\n\n### Température\n\n- Le Clivia apprécie des températures diurnes autour de 20°C à 25°C (68°F à 77°F) et peut tolérer des températures nocturnes plus fraîches. Une période de fraîcheur (10°C à 15°C / 50°F à 59°F) en hiver est nécessaire pour stimuler la floraison.\n\n### Humidité\n\n- Le Clivia tolère bien l'air sec des maisons, mais apprécie une humidité modérée. Vous pouvez augmenter l'humidité autour de la plante en plaçant le pot sur un plateau de galets humides.\n\n### Fertilisation\n\n- Appliquez un engrais liquide équilibré tous les mois pendant la saison de croissance. Cessez de fertiliser en automne et en hiver durant la période de repos.\n\n### Rempotage\n\n- Le Clivia préfère être à l'étroit dans son pot, donc un rempotage tous les 2 à 3 ans est généralement suffisant. Utilisez un terreau bien drainé et un pot seulement légèrement plus grand que le précédent.\n- Le meilleur moment pour rempoter est après la floraison ou au début du printemps.\n\n### Floraison\n\n- Pour encourager la floraison, assurez-vous que votre Clivia ait une période de repos au frais et au sec en hiver. Réduisez l'arrosage et maintenez la plante dans un endroit frais pendant environ 12 semaines avant de reprendre l'arrosage régulier et de la ramener à des températures plus chaudes.\n\n### Entretien général\n\n- Nettoyez régulièrement les feuilles avec un chiffon humide pour enlever la poussière.\n- Retirez les fleurs fanées pour conserver l'aspect esthétique de la plante et éviter la production de graines, qui épuise l'énergie de la plante.\n\nEn suivant ces conseils, votre Clivia miniata devrait prospérer et vous gratifier de ses magnifiques fleurs pendant de nombreuses années. Le Clivia est réputé pour sa longévité et sa capacité à devenir encore plus beau avec le temps.", famille_id: 3, conseil_expert: nil},
